        static void SetTimer() {
            var timer = new Timer(1000);
            timer.Elapsed += OnTimedEvent;
            timer.AutoReset = true;
            timer.Enabled = true;
        }
        
        private static void OnTimedEvent(Object source, ElapsedEventArgs e)
        {
            Console.WriteLine("The Elapsed event was raised at {0:HH:mm:ss.fff}",
                e.SignalTime);
        }
        
        static void Print(IReadOnlyList<int> a) {
            foreach (var elem in a) {
                Console.Write($"{elem} ");
            }

            Console.WriteLine();
        }

        static int[] RandomNumbers(int quantity, int rangeStart, int rangeEnd) {
            var rand = new Random();
            var numbers = new int[quantity];

            lock (rand) {
                for (var i = 0; i < quantity; i++)
                    numbers[i] = rand.Next(rangeStart, rangeEnd);
            }

            return numbers;
        }
        
        static int fibonacci(int n) {
            if (n == 0)
                return 0;
            if (n == 1)
                return 1;
            return fibonacci(n - 1) + fibonacci(n - 2);
        }

        static int[] sort(int[] l) {
            if (l.Length <= 1)
                return l;
            else {
                var i = menor(l);
                return null;
            }
        }

        private static int menor(int[] l) {
            var m = int.MaxValue;
            foreach (var elem in l)
                if (elem <= m)
                    m = elem;
            return m;
        }

        /***
         * Cormen 3rd Edition, Find Max Subarray
         */
        static (int, int, int) FindMaxCrossingSubArray(int[] A, int low, int mid, int high) {
            var leftSum = int.MinValue;
            var sum = 0;
            int maxLeft = -1;
            for (var i = mid; i > low; i--) {
                sum += A[i];
                if (sum > leftSum) {
                    leftSum = sum;
                    maxLeft = i;
                }
            }

            var rightSum = int.MinValue;
            sum = 0;
            int maxRight = -1;
            for (var j = mid + 1; j < high; j++) {
                sum += A[j];
                if (sum > rightSum) {
                    rightSum = sum;
                    maxRight = j;
                }
            }

            return (maxLeft, maxRight, leftSum + rightSum);
        }

        static (int, int, int) FindMaximunSubArray(int[] A, int low, int high) {
            if (high == low)
                return (low, high, A[low]);

            var mid = (int) Math.Floor((double) ((low + high) / 2));
            var (leftLow, leftHigh, leftSum) = FindMaximunSubArray(A, low, mid);
            var (rightLow, rightHigh, rightSum) = FindMaximunSubArray(A, mid + 1, high);
            var (crossLow, crossHigh, crossSum) = FindMaxCrossingSubArray(A, low, mid, high);

            if (leftSum >= rightSum && leftSum >= crossSum)
                return (leftLow, leftHigh, leftSum);
            if (rightSum >= leftSum && rightSum >= crossSum)
                return (rightLow, rightHigh, rightSum);
            return (crossLow, crossHigh, crossSum);

        }

        /**
         * Traditional matrix multiplication 
         */
        static int[,] SquareMatrixMultiplication(int[,] A, int[,] B) {
            var n = A.Length/2;
            Console.WriteLine($"Inside function n: {n}");
            var C = new int[n, n];
            for (var i = 0;  i < n; i++) {
                for (var j = 0; j < n; j++) {
                    C[i, j] = 0;
                    for (var k = 0; k < n; k++)
                        C[i, j] = C[i, j] + A[i, k] * B[k, j];
                } 
            }

            return C;
        }
